description:
Join us in REVELATION 17 as we study the woman and the beast. At first we read the woman is riding the beast. But then we read the beast is taking the woman for a ride. As is the way of sin, the beast ends up devouring the woman. Understand the devastation that comes from sin, and be made free from death through Jesus Christ.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
